    const folderIndex = activeFolders.indexOf(folderName);
    if (folderIndex === -1) {
      setActiveFolders([...activeFolders, folderName]);
    } else {
      setActiveFolders(activeFolders.slice(0, folderIndex + 1));
    }
  };

  return (
    <div className="App">
      <div className="folders">
        {activeFolders.map((folderName, index) => (
          <div key={folderName} className="folder" onClick={() => handleFolderClick(folderName)}>
            {folderName}
          </div>
        ))}
      </div>

      <div className="content">
        {activeFolders.length === 0 ? (
          mainFolders.map((mainFolder) => (
